CREATE TABLE parking_meters (
    ObjectId INT PRIMARY KEY,
    "METER_NO" INT,
    "CATEGORY" VARCHAR(255),
    "STREET" VARCHAR(255),
    "SUBURB" VARCHAR(255),
    "MAX_STAY_HRS" VARCHAR(255),
    "RESTRICTIONS" VARCHAR(255),
    "OPERATIONAL_DAY" VARCHAR(255),
    "OPERATIONAL_TIME" VARCHAR(255),
    "TAR_ZONE" VARCHAR(255),
    "TAR_RATE_WEEKDAY" FLOAT,
    "TAR_RATE_AH_WE" FLOAT,
    "LOC_DESC" VARCHAR(255),
    "VEH_BAYS" INT,
    "MC_BAYS" INT,
    "MC_RATE" FLOAT,
    "LONGITUDE" FLOAT,
    "LATITUDE" FLOAT,
    "MOBILE_ZONE" INT,
    "MAX_CAP_CHG" VARCHAR(255),
    "geo_shape" VARCHAR(255),
    "geo_point_2d" VARCHAR(255),
    "VEH_BAYS_INT" INT
);
